import React, { Fragment, useReducer } from "react";
import AppRoutes from "./components"; // Your main routes
import { LayoutContext } from "./components/shop/LayoutContext";
import { layoutState, layoutReducer } from "./components/shop/layoutReducer";

function App() {
  const [data, dispatch] = useReducer(layoutReducer, layoutState);

  return (
    <Fragment>
      <LayoutContext.Provider value={{ data, dispatch }}>
        <AppRoutes />
      </LayoutContext.Provider>
    </Fragment>
  );
}

export default App;
